import React, { useEffect,useState } from 'react';
import fetch_token from './fetch_token.js'; // 导入 fetch_token 函数
import fetch_calendar from './calendar.js';

function App() {
    const username = "1wadadwa5219";
    const [calendarData, setCalendarData] = useState([]); 

    useEffect(() => {
        // 调用 fetch_token 函数并传递 username 和 team 参数
        fetch_token(username, "울산");
    }, [username]); // 当 username 变化时重新调用

    const token = localStorage.getItem('access_token');
    const message = localStorage.getItem('msg');

    useEffect(() => {
      fetch_calendar(token).then(data => {
          setCalendarData(data); // 存储获取到的数据
      });
  }, [token])

    return (
        <div>
            <h3>Information</h3>
            <p>Token: {token || "No token available"}</p>
            <p>Message: {message || "No message available"}</p>

            <h3>Past Events</h3>
            <ul>
                {calendarData.map(event => (
                    <li key={event.id}> {/* 假设每个事件都有一个唯一的 id */}
                        {event.title} - {event.date} {/* 假设事件有 title 和 date 字段 */}
                    </li>
                ))}
            </ul>
        </div>


    );
}

export default App;




